import React, { useState } from "react";
import { useForm } from "react-hook-form";
import axios from "axios";
import "./styles.css";

const Cadastro = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const [hasComorbidities, setHasComorbidities] = useState(false);

  const onSubmit = async (data) => {
    try {
      const response = await axios.post("http://127.0.0.1:5000/register", data);
      alert(response.data.message);
    } catch (error) {
      alert(error.response.data.message);
    }
  };

  return (
    <div className="container">
      <h1>Register</h1>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div>
          <label>Nome Completo</label>
          <input type="text" {...register("nome")} />
        </div>
        <div>
          <label>CPF</label>
          <input type="text" {...register("cpf")} />
        </div>
        <div>
          <label>Senha</label>
          <input type="password" {...register("password")} />
        </div>
        <div>
          <label>Idade</label>
          <input type="number" {...register("idade")} />
        </div>
        <div>
          <label>Endere√ßo</label>
          <input type="text" {...register("endereco")} />
        </div>
        <div>
          <label>Data de Nascimento</label>
          <input type="date" {...register("dataNascimento")} />
        </div>
        <div>
          <label>Estado de Origem</label>
          <input type="text" {...register("estadoOrigem")} />
        </div>
        <div>
          <label>Cidade</label>
          <input type="text" {...register("cidade")} />
        </div>
        <div>
          <label>Comorbidades</label>
          <input type="text" {...register("comorbidades")} />
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Cadastro;
